import React from "react";
import "./App.css";
import Login from "./component/Login";
import Register from "./component/Register";

export default class App extends React.Component {
  state = {
    goToRegister: false,
  };

  render() {
    if (this.state.goToRegister)
      return (
        <div className="App">
          <Register />
        </div>
      );
    else
      return (
        <div className="App">
          <Login />
        <button onClick={this.state({goToRegister})}>Register</button>
        </div>
      );

    return (
      <div className="App">
        <br />
        <br />
        <br />
        <br />
        <br />
      </div>
    );
  }
}
